def min_Jumps(n: int, n2: int, n3: int) -> int:
    jumps: List[int] = [float('inf')] * (n + 1)
    jumps[0] = 0
    for i in range(n + 1):
        if jumps[i] != float('inf'):
            if i + n2 <= n:
                jumps[i + n2] = min(jumps[i + n2], jumps[i] + 1)
            if i + n3 <= n:
                jumps[i + n3] = min(jumps[i + n3], jumps[i] + 1)
    if jumps[n] == float('inf'):
        return -1
    else:
        return jumps[n]

def min_Jumps2(x: int) -> int:
    if x == 0:
        return 0
    jumps = 0
    while x > 0:
        if x % 2 == 0:
            x = x // 2
        elif x % 3 == 0:
            x = x // 3
        else:
            x -= 1
        jumps += 1
    return jumps
