from typing import List

def largest_subset(lst: List[int], n: int) -> List[int]:
    dp = [[0] * n for _ in range(len(lst) + 1)]
    prev = [[[] for _ in range(n)] for _ in range(len(lst) + 1)]

    for i in range(1, len(lst) + 1):
        for j in range(n):
            if lst[i - 1] % (j + 1) == 0:
                if dp[i - 1][j] > dp[i - 1][lst[i - 1] % (j + 1)] + 1:
                    dp[i][j] = dp[i - 1][j]
                    prev[i][j] = prev[i - 1][j]
                else:
                    dp[i][j] = dp[i - 1][lst[i - 1] % (j + 1)] + 1
                    prev[i][j] = prev[i - 1][lst[i - 1] % (j + 1)] + [lst[i - 1]]
            else:
                dp[i][j] = dp[i - 1][j]
                prev[i][j] = prev[i - 1][j]

    max_len_idx = 0
    max_len = 0
    for i in range(n):
        if dp[-1][i] > max_len:
            max_len = dp[-1][i]
            max_len_idx = i

    return prev[-1][max_len_idx]
