import typing

def get_median(lst1: typing.List[int], lst2: typing.List[int], n: int) -> float:
    merged = []
    i, j = 0, 0

    while i < n and j < n:
        if lst1[i] < lst2[j]:
            merged.append(lst1[i])
            i += 1
        else:
            merged.append(lst2[j])
            j += 1

    while i < n:
        merged.append(lst1[i])
        i += 1

    while j < n:
        merged.append(lst2[j])
        j += 1

    if len(merged) % 2 == 0:
        return (merged[len(merged) // 2 - 1] + merged[len(merged) // 2]) / 2
    else:
        return merged[len(merged) // 2]
