from typing import List

def min_jumps(lst: List[int], n: int) -> int:
    if n <= 1:
        return 0
    if lst[0] == 0:
        return -1

    max_reach = lst[0]
    step = lst[0]
    jump = 1

    for i in range(1, n):
        if i == n - 1:
            return jump
        max_reach = max(max_reach, i + lst[i])
        step -= 1
        if step == 0:
            jump += 1
            if i >= max_reach:
                return -1
            step = max_reach - i
    return -1
