from collections import deque

def minSwaps(s, s2):
    n = len(s)
    queue = deque([(s, 0)])
    visited = {s}

    while queue:
        curr, steps = queue.popleft()
        if curr == s2:
            return steps

        for i in range(n - 1):
            next_str = list(curr)
            next_str[i], next_str[i + 1] = next_str[i + 1], next_str[i]
            next_str = ''.join(next_str)

            if next_str not in visited:
                queue.append((next_str, steps + 1))
                visited.add(next_str)

    return -1
