def product_Equal(n: Union[int, str]) -> bool:
    if isinstance(n, int):
        str_n = str(n)
    else:
        str_n = n

    if not str_n.isdigit():
        raise ValueError("Input must be an integer or a string representing an integer.")

    digits = [int(d) for d in str_n]

    product_even = 1
    product_odd = 1

    for i, digit in enumerate(digits):
        if i % 2 == 0:
            product_even *= digit
        else:
            product_odd *= digit

    return (product_even % 2 == 0) == (product_odd % 2 == 0)
```

