from typing import List

def maxAverageOfPath(lst: List[List[int]], n: int) -> float:
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    dp = [[0.0]*n for _ in range(n)]

    dp[0][0] = lst[0][0]

    for i in range(n):
        for j in range(n):
            if i == 0 and j == 0:
                continue
            max_val = float('-inf')
            for dx, dy in directions:
                x, y = i + dx, j + dy
                if 0 <= x < n and 0 <= y < n:
                    max_val = max(max_val, dp[x][y])
            dp[i][j] = max_val / (lst[i][j] + 1)

    max_avg = float('-inf')
    for i in range(n):
        for j in range(n):
            max_avg = max(max_avg, dp[i][j] / (i + j + 1))

    return max_avg

def maxAverageOfPathCorrect(lst: List[List[int]], n: int) -> float:
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    dp = [[0.0]*n for _ in range(n)]

    dp[0][0] = lst[0][0]

    for i in range(n):
        for j in range(n):
            if i == 0 and j == 0:
                continue
            max_val = float('-inf')
            for dx, dy in directions:
                x, y = i + dx, j + dy
                if 0 <= x < n and 0 <= y < n:
                    max_val = max(max_val, dp[x][y])
            if max_val != float('-inf'):
                dp[i][j] = max_val + lst[i][j]
            else:
                dp[i][j] = lst[i][j]

    max_avg = float('-inf')
    for i in range(n):
        for j in range(n):
            steps = i + j
            if steps >= 0:
                avg = dp[i][j] / (steps + 1)
                max_avg = max(max_avg, avg)

    return max_avg
```

