def lcs_of_three(s, s2, s3, n, n2, n3):
    m, n, o = len(s), len(s2), len(s3)
    dp = [[[0]*(o+1) for _ in range(n+1)] for _ in range(m+1)]

    for i in range(m+1):
        for j in range(n+1):
            for k in range(o+1):
                if i == 0 or j == 0 or k == 0:
                    dp[i][j][k] = 0
                elif s[i-1] == s2[j-1] == s3[k-1]:
                    dp[i][j][k] = dp[i-1][j-1][k-1] + 1
                else:
                    dp[i][j][k] = max(dp[i-1][j][k], dp[i][j-1][k], dp[i][j][k-1])

    lcs = []
    i, j, k = m, n, o
    while i > 0 and j > 0 and k > 0:
        if s[i-1] == s2[j-1] == s3[k-1]:
            lcs.append(s[i-1])
            i -= 1
            j -= 1
            k -= 1
        else:
            max_val = max(dp[i-1][j][k], dp[i][j-1][k], dp[i][j][k-1])
            if max_val == dp[i-1][j][k]:
                i -= 1
            elif max_val == dp[i][j-1][k]:
                j -= 1
            else:
                k -= 1

    return ''.join(reversed(lcs))

