    count = 0
    freq = {}
    for i in range(n):
        if lst[i] in freq:
            freq[lst[i]] += 1
        else:
            freq[lst[i]] = 1
    for i in range(n):
        if sum - lst[i] in freq:
            if sum - lst[i] == lst[i]:
                count += freq[lst[i]] - 1
