import re

def check_email(s):
    if "@" not in s:
        return False
    local_part, domain = s.rsplit("@", 1)
    if not local_part or not domain:
        return False
    if not re.match(r"^[a-zA-Z0-9_.+-]+$", local_part):
        return False
    if not re.match(r"^[a-zA-Z0-9.-]+\.[a-zA-Z]{2,}$", domain):
        return False
    return True
