def left_Rotate(n, k):
    import math
    if not isinstance(n, int) or not isinstance(k, int):
        raise TypeError("Both n and k must be integers.")
    if n == 0:
        return 0
    k = k % (int(math.log2(n)) + 1)
    return (n << k) | (n >> (int(math.log2(n)) + 1 - k))

