def Sum_of_Inverse_Divisors(n, n2):
    sum = 0
    for i in range(1, int(math.sqrt(n)) + 1):
        if n % i == 0:
            if i <= n2:
                sum += 1 / i
            if n // i <= n2 and n // i != i:
                sum += 1 / (n // i)
    return sum
