def find_Min_Swaps(lst: List[int], n: int) -> int:
    swaps = 0
    for i in range(n):
        if lst[i] != 0:
            continue
        j = i + 1
        while j < n and lst[j] == 0:
            j += 1
        if j == n:
            break
        lst[i], lst[j] = lst[j], lst[i]
        swaps += 1
    return swaps
