import sys
import heapq

def check(lst, n):
    if n == 1:
        return True
    if n == 2:
        return lst[0] <= lst[1]
    heap = []
    for i in range(n):
        if i % (n-1) == 0:
            heapq.heappush(heap, lst[i])
    sorted_heap = []
    while heap:
        sorted_heap.append(heapq.heappop(heap))
    return sorted_heap == sorted(lst)
