from typing import List

def lbs(lst: List[int]) -> List[int]:
    n = len(lst)

    if n == 0:
        return []

    increase = [1]*n
    decrease = [1]*n

    for i in range(1, n):
        for j in range(i):
            if lst[i] > lst[j] and increase[i] < increase[j] + 1:
                increase[i] = increase[j] + 1

    for i in range(n-2, -1, -1):
        for j in range(n-1, i, -1):
            if lst[i] > lst[j] and decrease[i] < decrease[j] + 1:
                decrease[i] = decrease[j] + 1

    max_len = 0
    index = 0
    for i in range(n):
        if increase[i] + decrease[i] - 1 > max_len:
            max_len = increase[i] + decrease[i] - 1
            index = i

    res = []
    i = index - increase[index] + 1
    while i <= index:
        res.append(lst[i])
        i += 1
    i = index + 1
    while i < index + decrease[index]:
        res.append(lst[i])
        i += 1
    return res
```

