from collections import Counter

def min_Swaps(s, s2):
    if len(s) != len(s2):
        return -1
    if len(s) == 0:
        return 0

    diff_count = 0
    for i in range(len(s)):
        if s[i] != s2[i]:
            diff_count += 1

    return diff_count // 2
